/** @format */

import React from 'react';
import { Link } from 'react-router-dom';

export default function Header({ isLoined }) {
  return (
    <header className='fixed'>
      <nav className='flex gap-5 p-3'>
        <div>
          <Link to={'/'}>홈</Link>
        </div>
        <div>
          <Link to={'/join'}>회원가입</Link>
        </div>

        <div>
          {isLoined ? (
            <button>로그아웃</button>
          ) : (
            <Link to={'/login'}>로그인</Link>
          )}
        </div>
      </nav>
    </header>
  );
}
